import { Button } from 'react-bootstrap';
import { Photo } from '../../redux/reducer';
import MenuItem from './MenuItem';
interface Props {
  data: Array<Photo>;
}
function Menu({ data }: Props) {
  return (
    <div style={{ border: '1px solid #f0f0f0', padding: '30px', minHeight: '200vh', borderRadius: '6px' }}>
      <div className="d-flex justify-content-center flex-column">
        <div className="d-flex justify-content-center mb-4" style={{ position: 'sticky', top: '20px' }}>
          <Button className="me-4" style={{ minWidth: '200px', minHeight: '40px', boxShadow: '0px 2px 3px #555' }}>
            Confirm
          </Button>
          <Button color="warn" style={{ minWidth: '200px', boxShadow: '0px 2px 3px #555' }}>
            Reset
          </Button>
        </div>
        {data.map((el, index) => {
          return <MenuItem key={el.id} data={el} />;
        })}
        <div className="d-flex justify-content-center" style={{ height: '50px' }}>
          <div className="shapes"></div>
        </div>
      </div>
    </div>
  );
}

export default Menu;
